        /// Keeps track of planets in a sign box so that stack nicely
        /// </summary>
        private static Dictionary<HouseName, int> ChartOccupiedMarker { get; set; } =
            new Dictionary<HouseName, int>()
            {
                { HouseName.House1, 0 },
                {HouseName.House2, 0 },
                { HouseName.House3, 0 },
                { HouseName.House4, 0 },
                { HouseName.House5, 0 },
                { HouseName.House6, 0 },
                { HouseName.House7, 0 },
                { HouseName.House8, 0 },
                { HouseName.House9, 0 },
                { HouseName.House10, 0 },
                { HouseName.House11, 0 },
                { HouseName.House12, 0 },
            };

        private static Dictionary<HouseName, dynamic> ChartSignCoordinates { get; set; } =
            new Dictionary<HouseName, dynamic>()
            {
                { HouseName.House1, new { xAxis = 310, yAxis = 100 } },
                { HouseName.House2, new { xAxis = 530, yAxis = 100 } },
                { HouseName.House3, new { xAxis = 750, yAxis = 100 } },
                { HouseName.House4, new { xAxis = 750, yAxis = 320 } },
                { HouseName.House5, new { xAxis = 750, yAxis = 540 } },
                { HouseName.House6, new { xAxis = 750, yAxis = 760 } },
                { HouseName.House7, new { xAxis = 530, yAxis = 760 } },
                { HouseName.House8, new { xAxis = 310, yAxis = 760 } },
                { HouseName.House9, new { xAxis = 90, yAxis = 760 } },
                { HouseName.House10, new { xAxis = 90, yAxis = 540 } },
                { HouseName.House11, new { xAxis = 90, yAxis = 320 } },
                { HouseName.House12, new { xAxis = 90, yAxis = 100 } },
            };




        /// <summary>
        /// Sweet heart takes this away!
        /// Basically generating 1 frame
        /// </summary>
        public static string GenerateChart(Time time, double widthPx, double heightPx)
        {
            //PART I : declare the components
            string svgHead = null;
            string svgTail = null;
            string border = null;
            string contentTail = null;
            string content = null;
            string Planets = null;
            string signRuler = null;
            string houseRuler = null;
            string zodiacRuler = null;
            string dateTimeLocation = null;
            string locationHeader = null;



            //PART II : fill the components in order
            GenerateComponents();



            //PART III : compile in right placement
            var final =
                $@" <!--MADE BY MACHINES FOR HUMAN EYES-->
                    {svgHead}
                        {StaticBackgroundLayer}
                        {Planets}
                    {svgTail}
                ";


            return final;




            //------------------------LOCALS NEEDED FOR REFS

            async void GenerateComponents()
            {
                //STEP 0: RESET
                foreach (var house in House.AllHouses) { ChartOccupiedMarker[house] = 0; }

                //STEP 1: USER INPUT > USABLE DATA
                var svgBackgroundColor = "#f0f2f5"; //not bleach white
                var randomId = Tools.GenerateId();

                Planets = GetPlanetsPositionLayer(time);


                //note: if width & height not hard set, parent div clips it
                var svgTotalHeight = heightPx;//todo for now hard set, future use: verticalYAxis;
                var svgTotalWidth = widthPx;//todo for now hard set, future use: verticalYAxis;
                var svgStyle = $@"background:{svgBackgroundColor};";//end of style tag
                svgHead = $"<svg viewBox=\"0 0 {svgTotalWidth} {svgTotalHeight}\" width=\"{svgTotalWidth}px\" height=\"{svgTotalHeight}px\" style=\"{svgStyle}\" class=\"SkyChartHolder\" id=\"{randomId}\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\">";//much needed for use tags to work

                svgTail = "</svg>";
                contentTail = "</g>";


            }

        }

        private static string GetPlanetsPositionLayer(Time time)
        {
            var compiled = "";
            var allPlanetsSigns = Calculate.AllPlanetHousePositions(time);

            foreach (var planetSign in allPlanetsSigns)
            {
                var houseName = planetSign.Value;
                var coordinates = GetPositionForHouse(houseName);
                var xx = $"<text  transform=\"matrix(1 0 0 1 {coordinates.xAxis} {coordinates.yAxis})\" font-size=\"35\" fill=\"black\">{planetSign.Key}</text>";
                compiled += xx;
            }

            var finalGroup = $@"<g id=""PlanetLayer"">{compiled}</g>";

            return finalGroup;
        }


        /// <summary>
        /// Given a house name will return x & y for start of house
        /// </summary>
        private static dynamic GetPositionForHouse(HouseName houseName)
        {

            var xAxis = 0;
            var yAxis = 0;


            //check if occupancy number
            var occupancy = ChartOccupiedMarker[houseName];
            var jumpCount = occupancy * 45;

            //increment for next check
            ChartOccupiedMarker[houseName]++;

            //get the coordinates
            xAxis = ChartSignCoordinates[houseName].xAxis;
            yAxis = ChartSignCoordinates[houseName].yAxis + jumpCount; //if any will go next row


            return new { xAxis = xAxis, yAxis = yAxis };
        }


    }

